import React, { Component } from 'react';
import {
    OwpButton,
    OwpSearchDateField,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpTextField,
    OwpTreeGrid,
} from 'owp/wrapper';
import Formsy from 'formsy-react';
import * as TGEvent from 'owp/TGEvent';
import moment from 'moment';
import { query } from 'owp/api';
import { setGridData } from 'main/GridUtill';

class Page extends Component {
    constructor(props) {
        super(props);
        //TODO:load this from parent
        this.state = {
            UNITPROCESSID: 140,
        };
    }
    /**
     * Owp에서 사용하는 인풋에 대해 모두 사용할 수 있는 change 이벤트 리시버
     * @param {Event} event 발생한 이벤트 객체
     * @param {Function} callback 콜백 함수. 인풋의 name, value를 인수로 전달함.
     */
    componentDidMount() {
        const _showApprovalDialog = this.showApprovalDialog;
        this.loadActiveGrid();
    }
    //날짜 디폴드값 설정 함수

    loadActiveGrid = () => {
        console.log('call query');
        query({
            url: '/listOWP_MBR_PROCESS_MAINActiveByUnitProcessID',
            params: {
                jsondata: JSON.stringify({
                    'OWP_MBR_PROCESS_MAIN.UNITPROCESSID': this.state.UNITPROCESSID + '',
                }),
            },
        })
            .then((res) => {
                if (res && res.length > 0) {
                    setGridData('C0202012', res);
                }
            })
            .catch((err) => {
                console.log(err);
            });
    };

    render() {
        return (
            <React.Fragment>
                <div style={{ width: '100%' }}>
                    <div className="row">
                        <div className="col-md-12" style={{ padding: '0' }}>
                            <OwpTreeGrid
                                id="C0202012"
                                LayoutUrl="assets/data/C0202012Def.xml"
                                width="100%"
                                height="21vh"
                            />
                        </div>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}

export default Page;
